import React from 'react';
import Filter from "../Filter/filter";
import {Nav,Row,Col} from 'react-bootstrap'
import classes from './navbar.module.css';

import {Link} from 'react-router-dom'

const Navbar = (props) => {
    const filter = () => {
        document
            .querySelector(".Filter")
            .classList
            .toggle("hide");
        console.log("filterOption");
    };
    return (
        <Row className={classes.Nav}>
            <Col sm={6}>

                        <Link to="/"><p className={`${classes.Navlink} props.view == "NearestRides" ? "active" : ""`} href="/">Nearest rides</p></Link>
                        <Link to="/"><p className={`${classes.Navlink} props.view == "UpcomingRides" ? "active" : ""`} href="/upcoming">Upcoming rides(4)</p></Link>
                        <Link to="/"><p className={`${classes.Navlink} props.view == "PastRides" ? "active" : ""`} href="/past">Past rides (3)</p></Link>

            </Col>
            <Col md={{ offset: 4 ,span: 2}}>
                <Filter/>
            </Col>
        </Row>
    );
};

export default Navbar;
